import React from "react";

function Note(props) {

function handleDeleteButton() {
  props.handleDelete(props.index)
}

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.index}</p>
      <p>{props.content}</p>
      <button onClick={handleDeleteButton} >DELETE</button>
    </div>
  );
}

export default Note;
